import React,{Component} from 'react';
import {View,Text,StyleSheet} from 'react-native';
import DatePicker from 'DatePickerAndroid';


export default class Teste1 extends Component  {
    
    state = {
        data:''
    }
    changeDate = (valor)=>{this.setState({data:valor})}
    render(){
    
    return (
        <View>
            <DatePicker format = 'DD/MM/YYYY' style = {{width:600}} date = {this.state.data} onDateChange={this.changeDate} />
            <Text> {this.state.data && <Text>Data Selecionada:{this.state.data}</Text>}</Text>
        </View>
    );
    }
    
}
